description:
Taken 28/02/24; Uploading the previous snaps of No. 23 I find it hard to visualise regular steam worked services on the UndergrounD.  I also struggle with the notion that, in my lifetime (well just about),  loco hauled services were a feature on the Metropolitan Line.  However, up until the the Amersham electrification in 1961, the 20 locos built by Metropolitan-Vickers in 1922-3  worked services as far as Rickmansworth, where  a steam loco took over.

Two of the class survive; No.  5 ‚ÄòJohn Hampden‚Äô seen here in the London Transport Museum at Covent Garden and No. 12 ‚ÄòSarah Siddons‚Äô, which has been preserved in operational condition.  No. 5 owes its survival to becoming the Acton Works shunter after its passenger duties ended.  On final withdrwal it was restored for the London Transport Collection at Syon Park in Brentford in 1973. It has been on display here at London Transport Museum since 1980, when the Covent Garden site opened.

Finally who was John Hampden?   Over to Wikipedia, Hampden  (1595 ‚Äì 1643) &quot;... was an English landowner and politician whose opposition to 'arbitrary' taxes imposed by Charles I made him a national figure. Allied with Parliamentarian leader John Pym, and cousin to Oliver Cromwell, he was among the Five Members whose attempted arrest in January 1642 helped to spark the First English Civil War.&quot;
